import React from "react";
import importFishStyle from "../../styles/ImportFish.module.scss";
const ImportFish = () => {
  return (
    <div className={importFishStyle.importFish}>
      <h2 id="hometitle" className={importFishStyle.homeTitle}>
        Cá Biển Nhập Khẩu
      </h2>
      <div id="product" className="d-flex">
        <div>
          <div className="card">
            <img
              className="card-img-top"
              src="http://www.vanthinhseafoods.com/images/Sanphamseafood/RED%20SQUIRED/Red%20Squirel%20fish.jpg"
              alt
            />
            <div className="card-body">
              <h4 className="card-title">Title</h4>
              <p className="card-text">Text</p>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default ImportFish;
